// Error satisfies the builtin error interface
func (e Metadata_PlanValidationError) Error() string {
	cause := ""
	if e.cause != nil {
		cause = fmt.Sprintf(" | caused by: %v", e.cause)
	}

	key := ""
	if e.key {
		key = "key for "
	}

	return fmt.Sprintf(
		"invalid %sMetadata_Plan.%s: %s%s",
		key,
		e.field,
		e.reason,
		cause)
}

var _ error = Metadata_PlanValidationError{}

var _ interface {
	Field() string
	Reason() string
	Key() bool
	Cause() error
	ErrorName() string
} = Metadata_PlanValidationError{}
